    false,nt"url": null,nt"notes": "This narrative report for Okefenokee National
    Wildlife Refuge summarizes refuge activities during the 1974 fiscal year.  The report
    begins with a summary of the weather and habitat conditions during the period.     Wildlife-
    including migratory birds, upland game birds, big game animals, fur animals, hawks,
    eagles, owls and etc, other birds, fish, reptiles, and disease- is also covered.
     The report includes a refuge development and maintenance section which discusses
    physical development, plantings, collections and receipts, control of vegetation,
    planned burning, fires .  Resource management is outlined; topics include grazing,
    haying, fur harvest, timber removal, commercial fishing, and other uses.  A progress
    report on field investigations and applied research is also provided.  The public
    relations section of the report discusses recreational uses, refuge visitors, refuge
    participation, hunting, violations, safety.  Items of interest are provided at the
    end of the report.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
